function Popup({ showPopup }) {
    return !showPopup ? null :
        (
            <div className="popup" >
                <div className="popup__inner">
                    <div className="popup__content">
                        <a className="popup__close" href="#"><img src={closeBtn} width="35px" height="35px"></img></a>
                        <ReactPlayer controls={true} url="https://www.youtube.com/watch?v=KvUgaHTNit4" />

                    </div>
                </div>
            </div>

        )
}

const mapStateToProps = (state) => ({
    showPopup: state.showPopup
})


export default connect(mapStateToProps)(Popup)
